// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

contract MappingsSample{

    // Mappings have one to one or one to many relationship
    // ONE to ONE relationship for now

    // State Variables
    mapping(string => string) public names;

    constructor() public{

       names["V"]     = "V";
       names["Toyin"] = "Toyin";
       names["Mark"]  = "Mark";
       names["Milad"] = "Milad";
       names["Taher"] = "Taher";

    }

    // What we need?
    /* names[0] = "V";
       names[1] = "Toyin";
       names[2] = "Mark";
       names[3] = "Milad";
       names[4] = "Taher"; */

       // why we cant use array for the purpose?

     function getOwner()
     view
     public
     returns(address){
         return msg.sender;
     }  

}

